import React, { useEffect, useState } from 'react';

function Archive() {
    const [savedLists, setSavedLists] = useState([]);

    useEffect(() => {

        const savedListsString = localStorage.getItem('savedLists');
        if (savedListsString) {
            const parsedLists = JSON.parse(savedListsString);
            setSavedLists(parsedLists);
        }
    }, []);

    return (
        <div>
            <h1>Listes Sauvegard√©es</h1>
            <ul>
                {savedLists.map((list, index) => (
                    <li key={index}>
                        <h2>{list.title}</h2>
                        <ul>
                            {list.items.map((item, itemIndex) => (
                                <li key={itemIndex}>{item}</li>
                            ))}
                        </ul>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default Archive;
